package Lecture3.com;

public class AssignmentOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int p=10;
		int q;
		q=p;
		System.out.println(q);
		
		p+=q;		
		System.out.println(p);
		p-=q;
		System.out.println(p);
		p/=q;
		System.out.println(p);
		p%=q;
		System.out.println(p);
	}

}
